import Api from '@/utils/Api'

export function addCampaignUser(data) {
    Api.addCampaignUser(data)
        .then(res => {
            if (res) {
                console.log('user is added' + res)
            }
        })
        .catch(err => {
            console.log('error is here for add user', err)
        })
}
